import './App.css';
import Form from './Form';
import FormDialog from './Example';
import Form2 from './Form2';
import Thirdow from './Thirdrow';
import Fourthrow from './Fourthrow';
import Setting from './Setting'
import Container from '@material-ui/core/Container';
import Dialog from './Dialog'
import Puttingallin from './Puttingallin';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <>     
      <Router>
      <Switch>
          <Route path="/Setting">
            <Setting/>
          </Route>
          <Route path="/Setting" >
            <Puttingallin/>
          </Route>
        </Switch>
      </Router>
   </>
  )
}

export default App;
